import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import UserList from './components/UserList';
import UserDetail from './components/UserDetail';
import UserForm from './components/UserForm';
import AccountList from './components/AccountList';
import AccountForm from './components/AccountForm';
import AccountDetail from './components/AccountDetail';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <div className="container mt-4">
        <h1 className="mb-4">ATM Application</h1>
        <Switch>
          <Route exact path="/users" component={UserList} />
          <Route path="/users/new" component={UserForm} />
          <Route path="/users/:id" exact component={UserDetail} />
          <Route path="/users/:id/edit" component={UserForm} />
          <Route path="/users/:id/accounts" exact component={AccountList} />
          <Route path="/users/:id/accounts/new" component={AccountForm} /> {/* Updated route */}
          <Route path="/users/:id/accounts/:acc_id" component={AccountDetail} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
